import React, {useState} from 'react';
import stl from './authPageNewPostMain.module.css';
import SubmitBtn from "../../../utilsUI/submitBtn/SubmitBtn";
import foundImg from './../../../../img/found.png';
import {auth} from "../../../../firebase/firebase-config";
import {writeNewPostData} from "../../../../firebase/pet-services";
import {getUid} from "../../../../firebase/auth-service";

const AuthPageNewPostMain = () => {
    const [text, setText] = useState(false);
    const [photo1, setPhoto1] = useState(false);
    const [photo2, setPhoto2] = useState(false);
    const [photo3, setPhoto3] = useState(false);
    const [photo4, setPhoto4] = useState(false);
    const userName = auth.currentUser.displayName;
    const userIconRef = auth.currentUser.photoURL;
    const uid = getUid();

    function handleFileSelect(event, photoNum) {
        const file = event.target.files[photoNum-1];
        const reader = new FileReader();
        console.log(event.target.files);
        reader.onload = function (event) {
            const contents = event.target.result;
            const string = btoa(contents);
            console.log(string);
            switch (photoNum){
                case 1:
                    setPhoto1(string);
                    break;
                case 2:
                    setPhoto2(string);
                    break;
                case 3:
                    setPhoto1(string);
                    break;
                case 4:
                    setPhoto1(string);
                    break;
                default:
                    console.log('error');
            }
        }
        reader.readAsDataURL(file);
    }

    const handlerSubmitCLick = ()=> {
        let time = new Date();
        let data = {
            userIcon: userIconRef,
            date: time.getTime(),
            userName,
            text,
            photo1,
            photo2,
            photo3,
            photo4
        };
        console.log(data);
        writeNewPostData(uid, data);
    };


    return (
        <div>
            <form method="post">
                <div>
                    <label htmlFor="text-input">Text input:</label>
                    <input type="text" id="text-input" name="text-input" onChange={(e)=>setText(e.currentTarget.value)}/>
                </div>
                <div>
                    <label htmlFor="photo1">Photo 1:</label>
                    <input type="file" id="photo1" name="photo1" onChange={e=>handleFileSelect(e, 1)}/>
                </div>
                <div>
                    <label htmlFor="photo2">Photo 2:</label>
                    <input type="file" id="photo2" name="photo2" onChange={e=>handleFileSelect(e, 2)}/>
                </div>
                <div>
                    <label htmlFor="photo3">Photo 3:</label>
                    <input type="file" id="photo3" name="photo3" onChange={e=>handleFileSelect(e, 3)}/>
                </div>
                <div>
                    <label htmlFor="photo4">Photo 4:</label>
                    <input type="file" id="photo4" name="photo4" onChange={e=>handleFileSelect(e, 4)}/>
                </div>
                <div onClick={()=> handlerSubmitCLick()}>
                    <SubmitBtn img={foundImg} width={'148'} text={'Submit'}/>
                </div>
            </form>
        </div>
    );
};

export default AuthPageNewPostMain;


